const int = (number) => parseInt(number, 10);

const bindEvent = (el, name, cb) => {
  el.addEventListener(name, cb)
}

const loadImage = (src, cb) => {
  const img = new Image();
  img.src = src;
  bindEvent(img, 'load',  () => {
    cb(img);
  })
};
